import React from "react";
import "./ProjectTabs.css";
import { Nav, Tabs, Tab, Row, Col } from "react-bootstrap";

const ProjectTitles = {
  ridsi: { title: "RIDSI", key: "ridsi" },
  events: { title: "Missouri Bicentennial Events", key: "events" },
  other: { title: "OTHER", key: "other" },
  other2: { title: "OTHER2", key: "other2" },
};

const ProjectItems: React.FC = () => {
  const Items = ProjectTitles;
  return <p>HIIII</p>;
};

const ProjectTabs: React.FC = () => {
  return (
    <div className="projects-body">
      <Row>
        <ProjectItems />
      </Row>
    </div>
  );
};
export default ProjectTabs;
